script: |
  super -f text -I q4002.spq | sort > q4002.out

inputs:
  - name: q4002.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 88 IN ( - col0 * - - col1 + - col0 + col1 * - + col0, - col1 * + col1, col2, col1 + - col0 * - 59, + - ( + col0 ) );
  - name: tab1

outputs:
  - name: q4002.out
    data: |
      51	14	96
      85	5	59
      91	47	68
